INSERT INTO `informasi` VALUES (1, 'Lisa Tailor', 'Jl. Panglima Batur No. 31 Rt. 003, Samarinda, Kalimantan Timur', 'Lisa', '085250510517', 'sipudtry', '1332004839', '1332004839', '<p style="">Cara melakukan Pemesanan Pembuatan Pakaian Pada website ini :</p><div class="home_paragraph" style="padding: 0px 10px 5px; text-align: justify; orphans: 2; widows: 2;"><div class="text" style="margin-top: 12px;"><ol><li>Sebelum Melakukan pemesanan di haruskan Registrasi terlebih dahulu, yaitu dengan mengklik menu pemesanan.</li><li>setelah berhasil registrasi kemudian login untuk melakukan pemesanan.</li><li>jika login berhasil, maka langsung saja mengklik menu <span style="text-decoration: underline;">proses pemesanan pakaian</span>.</li><li>setelah berada dalam halaman pemesanan, inputkan data pakaian yang anda ingin buat, kemudian simpan dan tunggu konfirmasi dari pihak kami dalam jangka waktu 2x24 Jam.</li><li>Kemudian anda dapat mengecek pemesanan anda disetujui atau tidak pada halaman riwayat pemesanan > cek pemesanan.</li><li style="orphans: auto; text-align: left; widows: auto; ">jika pemesanan dari anda telah disetujui pihak kami, maka anda harus mencetak bukti pemesanan yang telah disediakan di website kami dan mentransfer biaya kerekening kami kemudian menginputkan bukti resi untuk pelanggan yang diluar kota samarinda</li><li style="orphans: auto; text-align: left; widows: auto; ">setelah itu untuk anda yang berada di Samarinda, yang pemesanannya telah di setujui maka dapat langsung datang ketoko kami untuk melakukan pengukuran badan, serta membawa bukti pemesanan yang telah anda cetak dan bahan kain.</li><li style="orphans: auto; text-align: left; widows: auto; ">Dan untuk anda yang berada diluar samarinda yang pemesanannya telah di setujui, dan tidak dapat datang langsung ketoko kami untuk melakukan pengukuran badan, maka dapat mengirim contoh pakaian yang dapat kami ukur serta mengirim bukti pemesanan dan bukti pembayaran. agar segera dapat kami proses.</li><li style="orphans: auto; text-align: left; widows: auto; ">Jika pengiriman contoh pakaian dan bahan kain dari pelanggan yang berada di luar samarinda, tidak sampai ke toko kami dalam jangka waktu 3x24 jam maka pemesanan kami nyatakan batal, dan biaya yang telah anda tranfers akan kami kembalikan kerekening anda.</li></ol></div></div>', '<p>Pertanyaan yang sering ditanyakan adalah sebagai berikut :</p><p>1. Apakah dapat kami mengundang pihak Lisa Tailor ketempat yang diinginkan oleh pemesan, untuk melakukan proses pengukuran badan, dikarenakan pihak kami tidak dapat datang ke toko Lisa Tailor Tailor?</p><p>Jawaban : Untuk yang berada dikawasan Samarinda tentu dapat, tetepi untuk yang berada diluar kota Samarinda, pihak kami dapat datang jika biaya perjalanan ditanggung oleh yang mengundang. :)Â </p>', '<p style="">Lisa Tailor adalah usaha yang bergerak di bidang pembuatan pakaian. Dimana Berdiri sejak tahun 1988, dan berdiri hingga saat ini. Lisa Tailor dapat menerima pembuatan berbagai macam jenis dan model pakaian.</p><p class="MsoListParagraphCxSpFirst" style="margin-left: 21.3pt;"><span times="" new="" roman","serif";mso-ansi-language:in"="">Jenis pakaian yang\r\ndapat dipesan melalui pemesanan online ini\r\nadalah :<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin-left: 42.55pt;"><!--[if !supportLists]--><span times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";mso-ansi-language:in"="">1)Â Â Â Â </span><span times="" new="" roman","serif";mso-ansi-language:in"="">Atasan Pria terdiri\r\ndari kemeja lengan panjang, kemeja lengan pendek, jas dan pakaian dinas.<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin-left: 42.55pt;"><!--[if !supportLists]--><span times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";mso-ansi-language:in"="">2)Â .Â </span><span times="" new="" roman","serif";mso-ansi-language:in"="">Bawahan Pria\r\nterdiri dari celana panjang, celana santai dan celana pendek.<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin-left: 42.55pt;"><!--[if !supportLists]--><span times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";mso-ansi-language:in"="">3). Â </span><!--[endif]--><span times="" new="" roman","serif";mso-ansi-language:in"="">Atasan Wanita\r\nterdiri dari blues dan pakaian dinas.<o:p></o:p></span></p><p style="text-align: justify; ">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoListParagraphCxSpLast" style="margin-left: 42.55pt;"><!--[if !supportLists]--><span times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";mso-ansi-language:in"="">4). Â </span><!--[endif]--><span times="" new="" roman","serif";mso-ansi-language:in"="">Bawahan Wanita\r\nterdiri dari celana panjang, celana pendek, rok panjang dan rok pendek</span></p><p><br>Dalam Website Pemesanan Lisa Tailor ini, hanya dapat Â menerima pemesanan dalam wilayah kalimantan timur saja.<br>Jam buka toko kami pada Hari Senin - Sabtu mulai dari jam 09.00 WIB - 17.00 WITA.</p><p style="text-align: justify; "><br></p>');
